import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const FormBar = ({ name, label, icon, span }) => {
  return (
    <a download="" href={`../../static/pdfs/${name.replace(/ /g, "-")}.pdf`}>
      <span className="name">
        <span>{name}</span>
      </span>
      <span className={span}>
        <span>{label}</span>
        <span className="icon">
          <FontAwesomeIcon icon={icon} />
        </span>
      </span>
    </a>
  );
};

export default FormBar;
